defs.script:
      function cloneAndRotateKnobSprites()
	  {
        //alert("Javascript in SVG");
		var svg = document.getElementsByTagName('svg')[0];
        var rotaryKnobGroup = document.getElementById('rotaryKnob');
        var origRotaryScale = document.getElementById('rotaryScale');
        var origRotaryKnob = document.getElementById('knob');
        var origRotaryLightAndShadow = document.getElementById('rotaryLightAndShadow');
        var singleWidth=svg.getAttribute('width');
		for (var i=1;i<128;i++)
        {
            var newx = singleWidth*i;
            var cloneScale = origRotaryScale.cloneNode(true);
            cloneScale.setAttribute('id',origRotaryScale.getAttribute('id')+i);
            cloneScale.setAttribute('transform','translate('+newx+',0)');
            var cloneRotaryKnob = origRotaryKnob.cloneNode(true);
            cloneRotaryKnob.setAttribute('id',origRotaryKnob.getAttribute('id')+i);
            var angle = i*(300/128);// -149.7+i*2.3390625;
			cloneRotaryKnob.setAttribute('transform','translate('+newx+',0) rotate(' + angle +' 48 48)');
            var cloneLight = origRotaryLightAndShadow.cloneNode(true);
            cloneLight.setAttribute('id',origRotaryLightAndShadow.getAttribute('id')+i);
            cloneLight.setAttribute('transform','translate('+newx+',0)');
            rotaryKnobGroup.appendChild(cloneScale);
            rotaryKnobGroup.appendChild(cloneRotaryKnob);
            rotaryKnobGroup.appendChild(cloneLight);
        }
		svg.setAttribute('width',singleWidth*128);
        //document.removeChild('origRotaryScale');
        //document.removeChild('origRotaryKnob');
        //document.removeChild('origRotaryLightAndShadow');
      }
